import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Navbar from './components/common/Navbar';
import ProtectedRoute from './components/common/ProtectedRoute';
import Dashboard from './pages/Dashboard';
import AdminPanel from './pages/AdminPanel';
import TrainerView from './pages/TrainerView';
import TraineeView from './pages/TraineeView';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import TrainingList from './components/training/TrainingList';
import TrainingDetail from './components/training/TrainingDetail';
import TrainingPlanner from './components/training/TrainingPlanner';
import './styles/main.css';

function App() {
    return (
        <AuthProvider>
            <Router>
                <Navbar />
                <Switch>
                    <Route path="/login" component={Login} />
                    <Route path="/register" component={Register} />
                    <ProtectedRoute path="/dashboard" component={Dashboard} />
                    <ProtectedRoute path="/admin" component={AdminPanel} />
                    <ProtectedRoute path="/trainer" component={TrainerView} />
                    <ProtectedRoute path="/trainee" component={TraineeView} />
                    <ProtectedRoute path="/trainings" component={TrainingList} />
                    <ProtectedRoute path="/training/:id" component={TrainingDetail} />
                    <ProtectedRoute path="/training-planner" component={TrainingPlanner} />
                </Switch>
            </Router>
        </AuthProvider>
    );
}

export default App;
